            "  Алфабет Инк. - холдинговая компания. Бизнесы компании включают Гугл Инк. (Гугл)" +
                " и ее ",
            "  интернет-продукты, такие как Аксесс, Калико, КапиталГ, ГВ, Нест, Верилы, Ваемо " +
                "и ИКС. ",
            "  Сегменты компании включают Гугл и Адер Бэтс. Сегмент Гугл включает в себя его ",
            "  интернет-продукты, такие как поиск, реклама, коммерция, карты, Ютюб, Гугл Клауд" +
                ", ",
            "  Андроид, Хром и Гугл Плей, а также инициативы в области оборудования. Сегмент Г" +
                "угл ",
            "  занимается рекламой, продажами цифрового контента, приложений и облачных решени" +
                "й, ",
            "  а также продажей аппаратных продуктов. Сегмент Адер Бэтс занимается продажей ",
            "  интернет-услуг и телевизионных услуг через Гугл Фибер, продажей продуктов и усл" +
                "уг Нест, ",
            "  а также лицензированием и исследованиями и разработками (R&D) через Верилы. Ком" +
                "пания ",
